import React from 'react'

// import link
import { Link } from 'react-router-dom'

// import image
import intLOGO from '../../assets/images/interactlogo.SVG'

const socialLinks = [
{
  path: "#",
  icon: <i class="ri-facebook-line" />,
},
{
  path: "https://github.com/real-princejan/interactme",
  icon: <i class="ri-github-line" />,
},
{
  path: "#",
  icon: <i class="ri-twitter-x-line" />,
},
];

const quickLinks01 = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/checkin",
    display: "Activities",
  },
  {
    path: "/contact",
    display: "Contact",
  },
];

const Footer = () => {

  const year = new Date().getFullYear()

  return (
    <>
    <footer className='pb-16 pt-10'>
      <div className="container">
          <div className="flex justify-between flex-col md:flex-row flex-wrap gap-[30px]">
              <div className="">
                <img src={intLOGO} />
                <p className='text-[13px] leading-7 font-[400] text-gray-600 mt-4'>Copyright Â© {year} developed by Team Milyonaryo all right reserved.</p>

                <div className="flex items-center gap-3 mt-4">
                  {
                    socialLinks.map((link, index) => 
                    <Link to={link.path} key={index} className='w-9 h-9 border border-solid rounded-full flex items-center justify-center group hover:bg-brightColor hover:border-none'>
                      {link.icon}
                    </Link>)
                  }
                </div>

              </div>

              <div className="">
                <h2 className='text-md leading-[30px] font-[700] mb-6'>
                  Quick Links
                </h2>

                <ul>
                  {
                    quickLinks01.map((item, index) => 
                    <li key={index} className='mb-4 '>
                        <Link to={item.path} className='text-[16px] leading-7 font-[400]'>
                          {item.display}
                        </Link>
                    </li>)
                  }
                </ul>

              </div>

          </div>
      </div>     
    </footer>
    </>
  )
}

export default Footer
